class predata():
    """
    这个是为了解决原来写的mydataset数据集划分比较死板和固定的问题而弄的。
    index_path：id对应的label的路径
    split ：数据集划分时，测试集占比
    data_path ：数据集txt的保存路径

    """
    def __init__(self,index_path='./data/index.txt',data_path='./data/first_train_data/',split=0.2):
        self.index_path = index_path
        self.split = split
        self.getdata()
        self.splitdata()

    def getdata(self):
        self.label=[]
        self.data=[]
        lines = open(self.index_path, 'r', encoding='utf-8').readlines()
        for i in lines:
            i=i.strip()
            i=i.split('\t')
            #print(i)
            t=0
            if i[-1]=='qso':
                t=0
            elif i[-1]=='galaxy':
                t=1
            elif i[-1]=='star':
                t=2
            elif i[-1]=='unknown':
                t=3
            self.label.append(t)
            self.data.append(int(i[0]))
    def splitdata(self):
        self.list1=[i for i in range(len(self.data))]
        self.list2=random.sample(self.list1,int(len(self.label)*self.split))
        self.train_label = []
        self.train_data = []
        self.test_label = []
        self.test_data = []

        for i in self.list1:
            if i not in self.list2:
                self.train_label.append(self.label[i])
                self.train_data.append(self.data[i])
            else:
                self.test_label.append(self.label[i])
                self.test_data.append(self.data[i])

