def validation(data_loader,model,checkpoint=None):
    """
    # 验证函数，任务是在训练经过一定的轮数之后，对验证集中的数据进行预测并与真实结果进行比对，生成当前模型在验证集上的准确率
    :参数 data_loader:样本数据
    :参数 model:模型
    :参数 checkpoint:预训练模型,若有,则给出模型路径,在此模型基础上测试
    """

    model = model.to(device)
    # 加载预训练模型
    global start_epoch
    if checkpoint is not None:
        checkpoint = torch.load(checkpoint)
        start_epoch = checkpoint['epoch'] + 1
        model.load_state_dict(checkpoint['model'])

    # 自适应设备
    if torch.cuda.is_available() and ngpu > 1:
        model = nn.DataParallel(model, device_ids=list(range(ngpu)))

    # 准备完毕，开始测试了
    correct = 0
    total = 0
    accuracy = 0
    model.eval()
    real=[]
    pre=[]
    with torch.no_grad():  # 该函数的意义需在实验报告中写明
        for data in data_loader:

            images, true_labels = data
            images = images.to(device)
            true_labels = true_labels.to(device)


            # 前向传播
            pre_labels = model(images)
            total += pre_labels.shape[0]#总测试数

            #判断正误
            for i in range(pre_labels.shape[0]):
                real.append(int(torch.argmax(true_labels[i])))
                pre.append(int(torch.argmax(pre_labels[i])))
                #print(pre_labels[i],torch.argmax(pre_labels[i]) ,torch.argmax(true_labels[i]))
                if torch.argmax(pre_labels[i]) == torch.argmax(true_labels[i]):
                    correct += 1

    print("验证集数据总量：", total, "预测正确的数量：", correct)
    accuracy=correct/total
    print("当前模型在验证集上的准确率为：", accuracy)
    global acc
    acc.append(accuracy)



    return  accuracy

def label_smoothing(inputs, epsilon=0.3):
    K = inputs.shape[0]    # number of channels
    return ((1-epsilon) * inputs) + (epsilon / K)
    #out=0.7*inputs+0.1
    #return out
def train(epoch_num,data_loader,learning_rate,model,optimizer,criterion_type='mse',checkpoint=None,val_loader=None,
          save_checkpoint=None,label_smooth=None,num_val=1):
    """
    :参数 epoch_num: train的轮数
    :参数 data_loader:样本数据
    :参数 learning_rate:学习率
    :参数 model:模型
    :参数 optimizer:选择优化器 'sgd'或'adam'
    :参数 criterion_type:选择损失函数
    :参数 checkpoint:预训练模型,若有,则给出模型路径,在模型基础上再训练
    :参数val_loader:测试集
    :参数 save_checkpoint:模型保存地址
    :参数 label_smooth:是否进行平滑
    :参数 num_val:几轮验证一次
    """
    # 获取设备，后续将迁移至设备进行训练
    model = model.to(device)
    # 优化器设置
    optimizer=optimizer.lower()
    # 给定模型的参数model_parameters，利用filter排除所有requires_grad = Fasle，即不需要更新梯度的参数。对需要更新梯度的参数进行SGD
    if optimizer=='sgd':
        optimizer = torch.optim.SGD(params=filter(lambda p: p.requires_grad, model.parameters()), lr=learning_rate)
    elif optimizer=='adam':
        optimizer = torch.optim.Adam(params=filter(lambda p: p.requires_grad, model.parameters()), lr=learning_rate)
    # 定义loss形式
    if criterion_type=='mse':
        criterion = nn.MSELoss().to(device)
    elif criterion_type=='ce':
        criterion=nn.CrossEntropyLoss().to(device)

    # 加载预训练模型
    global start_epoch
    start_epoch=0
    if checkpoint is not None:
        checkpoint = torch.load(checkpoint)
        start_epoch = checkpoint['epoch'] + 1
        model.load_state_dict(checkpoint['model'])
        optimizer.load_state_dict(checkpoint['optimizer'])

    # 自适应设备
    if torch.cuda.is_available() and ngpu > 1:
        model = nn.DataParallel(model, device_ids=list(range(ngpu)))

    loss_list=[]
    x_max=0
    x=0
    acc=[]
    # 开始逐轮训练
    for epoch in range(start_epoch,start_epoch+epoch_num):

        model.train()  # 训练模式：允许使用批样本归一化
        # 循环外可以自行添加必要内容
        for index, data_label in enumerate(data_loader, 0):

            data,label=data_label

            data=data.to(device)
            label=label.to(device)

            # 是否需要平滑
            if label_smooth != None:
                label = label_smoothing(label)

            optimizer.zero_grad()
            # 前向传播
            pre_labels=model(data)
            # 计算损失
            #pre_labels=pre_labels.to(torch.float32)
            loss = criterion(pre_labels,label)
            # 后向传播
            loss.backward()
            # 更新模型
            optimizer.step()

            if index==0:
                print('Train - Epoch %d, Batch: %d, Loss: %f' % (epoch, index, loss.data.item()))
            #print(model.state_dict())
            loss_list.append(loss.data.item())
        # 手动释放内存
        del data, pre_labels
        if epoch % num_val == 0:
            x=validation(data_loader=val_loader, model=model)
            # 运行过程中保存在验证集上准确率最高的模型:
            if x > x_max:
                x_max = x
                # 保存训练模型
                torch.save({
                    'epoch': epoch,
                    'model': model.state_dict(),
                    'optimizer': optimizer.state_dict()
                }, save_checkpoint)

    return loss_list

